arStrings.szText:
{c_label}Ataki na sekundę: {c_number}{s1}{/c}{/c}
{icon:bullet} Obliczane w oparciu o szybkość broni.
{icon:bullet} Ten współczynnik można zwiększyć za pomocą umiejętności oraz przedmiotów.

{c_label}Szansa na trafienie krytyczne: {c_number}{s1}{/c}{/c}
{icon:bullet} Trafienia krytyczne zadają {c_number}{s2}{/c} dodatkowych obrażeń.
{icon:bullet} Ten współczynnik można zwiększyć za pomocą przedmiotów.

{c_label}Wartość bloku tarczą: {c_number}{s1}{/c}{/c}
{icon:bullet} Wartość zablokowanych obrażeń podczas blokowania ataku.
{icon:bullet} Ten współczynnik można zwiększyć za pomocą umiejętności oraz przedmiotów.

{c_label}Maksimum zdrowia: {c_number}{s2}{/c}{/c}
{icon:bullet} Jeśli stracisz wszystkie punkty zdrowia, zginiesz.
{icon:bullet} Ten współczynnik można zwiększyć za pomocą umiejętności oraz przedmiotów.

{c_label}Punkty zdrowia za zabicie: {c_number}{s1}{/c}{/c}
{icon:bullet} Odzyskujesz {c_number}{s2}{/c} zdrowia za każdego zabitego wroga.
{icon:bullet} Ten współczynnik można zwiększyć za pomocą umiejętności oraz przedmiotów.

{c_label}Punkty zdrowia przy trafieniu: {c_number}{s1}{/c}{/c}
{icon:bullet} Odzyskujesz {c_number}{s2}{/c} zdrowia za każdego trafionego wroga.
{icon:bullet} Ten współczynnik można zwiększyć za pomocą umiejętności oraz przedmiotów.

{c_label}Dodatkowe obrażenia od trafień krytycznych: {/c}{c_number}{s1}{/c}
{icon:bullet} Ten współczynnik można zwiększyć za pomocą umiejętności i przedmiotów.
{icon:bullet} Maksymalny limit przeciw innym graczom: {c_number}{s2}{/c}.

{c_label}Szybkość ruchu:{/c} {c_number}{s1}{/c}
{icon:bullet} Biegniesz w tempie równym {c_number}{s2}{/c} podstawowej szybkości ruchu.
{icon:bullet} Przedmioty mogą zapewnić ci maksymalną premię {c_number}+25%{/c} do szybkości ruchu.

{c_label}Dodatkowe doświadczenie: {c_number}{s1}{/c}{/c}
{icon:bullet} Doświadczenie otrzymywane za zabijanie potworów jest zwiększone o {c_number}{s2}{/c}.
{icon:bullet} Mnożnik: {c_number}{s3}x{/c}. Mnożnik jest przyznawany w grach wieloosobowych.

{c_label}Ciernie:{/c} {c_number}{s1}{/c}
{icon:bullet} Zadają obrażenia atakującym wrogom. Nie aktywują się w przypadku efektów zadających obrażenia z upływem czasu.
{icon:bullet} Zadawane obrażenia zostają zwiększone o część twojego głównego atrybutu.

{c_label}Maksimum zdrowia: {c_number}{s2}{/c}{/c}
{icon:bullet} Jeśli towarzysze stracą wszystkie punkty zdrowia, zostają na krótki czas obezwładnieni. 
{icon:bullet} Ten współczynnik można zwiększyć za pomocą umiejętności oraz przedmiotów.

{c_label}Maksimum zdrowia: {c_number}{s2}{/c}{/c}
{icon:bullet} Jeśli towarzysze stracą wszystkie punkty zdrowia, zostają na krótki czas obezwładnieni. 
{icon:bullet} Ten współczynnik można zwiększyć za pomocą umiejętności oraz przedmiotów.

{c_label}Maksimum zdrowia: {c_number}{s2}{/c}{/c}
{icon:bullet} Jeśli towarzysze stracą wszystkie punkty zdrowia, zostają na krótki czas obezwładnieni. 
{icon:bullet} Ten współczynnik można zwiększyć za pomocą umiejętności oraz przedmiotów.

{c_label}Obrażenia obszarowe:{/c} {c_number}{s1}{/c}
{icon:bullet} Wszystkie ataki mają {c_number}{s2}{/c} szans na zadanie dodatkowo {c_number}{s3}{/c} obrażeń wrogom w promieniu {c_number}{s4}{/c} metrów.
{icon:bullet} Ten współczynnik można zwiększyć za pomocą przedmiotów.

{c_label}Zwiększenie obrażeń – {s1}:{/c} {c_number}{s2}{/c}
{icon:bullet} Zwiększa obrażenia zadawane przez umiejętności korzystające z tego żywiołu.
{icon:bullet} {s3} Obrażenia: {c_number}{s4}{/c}.

{c_label}Siła woli: {/c}{c_number}{s1} {/c}{c_lightgray}(Wpływ przedmiotów: {c_blue}{s4}{/c}){/c}{s2}
{icon:bullet} Zwiększa skuteczność otrzymywanego leczenia o {c_number}{s3}{/c}
{icon:bullet} Zwiększa obrażenia od {c_important}{u}przytłaczającego ataku{/u}{/c_important} o {c_number}{s5}{/c}

{c_label}Osłona po każdym zabiciu: {c_number}{s1}{/c}{/c}
{icon:bullet} Po zabiciu wroga zyskujesz osłonę chroniącą przed obrażeniami.
{icon:bullet} Liczbę absorbowanych obrażeń można zwiększyć przy pomocy przedmiotów.

{c_label}Skrócenie czasu odnowienia mikstur: {c_number}{s1}{/c}{/c}
{icon:bullet} Skraca czas odnowienia twoich mikstur.
{icon:bullet} Czas ten może ulec dalszemu skróceniu dzięki przedmiotom.

{c_label}Szansa na przytłoczenie:{/c} {c_number}{s1}{/c}
{icon:bullet} Przytłoczenie zadaje dodatkowe obrażenia w oparciu o sumę wartości twojego bieżącego zdrowia i umocnionego zdrowia.
{icon:bullet} Obrażenia z upływem czasu, moce pasywne i podtrzymywane nie mogą przytłaczać.
